.bottom {
  // height: 110vh;
  height: auto;
  // @include sectionBorderTest;
  position: relative;
  z-index: 20;

  &__newsletter {
    @include flexCentered;
    background: linear-gradient(
      295.61deg,
      rgb(142, 72, 155),
      rgba(16, 60, 120),
      rgba(0, 166, 176, 0.94)
    );
    padding: 6em;
    width: 100%;
    &-content {
      @include flexCentered;
      flex-direction: column;
      width: 100%;
    }
    &.container {
      color: $color-para;
      width: 100%;
      height: 50vh;
      padding: 1em;
    }

    &-header {
      font-size: $fontSize-h1;
      font-family: 'Poppins', sans-serif;
      letter-spacing: 1px;
      margin-bottom: 0.4em;
      margin-top: -2em;
      color: $color-heading;
      //   width: 52vw;
      @media screen and (max-width: 500px) {
        font-size: $fontSize-mL !important;
      }
    }

    &__sub-heading {
      font-size: $fontSize-h2;
      line-height: 3rem;
      color: #e9e9e7;
      @media screen and (max-width: 500px) {
        font-size: $fontSize-Sm;
      }
    }

    &-input {
      @include flexCentered;
      margin-top: 2em;
      // border: 1px solid black;
      height: 5em;
      padding: 1em;
      background-color: #f7f7f7;
      border-radius: 0.8em;
      // width: 100%;
      input {
        padding: 0.2em;
        width: 25em;
        background-color: #f7f7f7;
        color: rgb(51, 50, 50);
        border: none;
        font-weight: 600;
        &:focus {
          outline: 0;
        }
      }

      &__btn {
        padding: 0.8em;
        // position: absolute;
        // left: 45em;
        background: linear-gradient(
          154deg,
          #27282b 17.69%,
          rgb(75, 75, 75) 71.8%
        );
        border-radius: 0.4em;
        border: none;
        color: $color-para;
        &:hover {
          background: linear-gradient(154deg, #303030 17.69%, #6b7588 81.8%);
          padding: 0.8em;
        }
        &:active {
          background: linear-gradient(154deg, #3f3f3f 17%, #824d8a 90.8%);
        }
      }

      @media screen and (max-width: 500px) {
        width: 100%;
      }
    }
  }

  .footer {
    // height: 0vh;
    &__nav-container {
      // @include flexCentered;
      display: table;
      width: 100%;
    }
    &__top-container {
      @include flexCentered;
      justify-content: space-between;
      height: 100%;
      padding: 7em 0 7em 5em;
      display: table;
    }

    &__left {
      width: 50%;
      color: $color-para;
      text-align: start;
      // border: $borderTest;
      display: table-cell;
      &-text {
        font-size: $fontSize-S;
        width: 90%;
        margin-left: 2%;
      }
      &-logo {
        width: 86px;
        margin-bottom: 1em;
      }

      &-social-icon-container {
        @include flexCentered;
        justify-content: flex-start;
        font-size: $fontSize-m;

        i {
          color: whitesmoke;
          @include transition-fast;
          &:hover {
            color: skyblue;
            // font-size: $fontSize-mL;
            transform: scale(2);
          }
        }
      }

      &-social-icon {
        padding: 1em;
      }
    }

    &__middle {
      color: $color-para;
      // border: $borderTest;
      font-size: $fontSize-S;
      // @include flexCentered;
      // justify-content: space-around;
      display: table;
      width: 83%;
      &__company {
        display: table-cell;
      }
      &__company__right {
        display: table-cell;
      }
    }

    a {
      color: $color-para;
    }

    ul > li > a:hover {
      color: skyblue;
      font-size: 1.3rem;
    }
    &__middle-nav {
      padding: 0.5em 0;
    }

    &__right__download {
      display: table-cell;
      width: 20%;
      &.content {
        width: 100%;
      }

      &-header {
        color: $color-para;
        padding: 1em 0;
        font-size: $fontSize-S;
      }

      &-apple {
        #apple {
          @include flexCentered;
          // background-color: rgb(137, 138, 139);
          background: linear-gradient(120.21deg, #babdc2, rgb(104, 107, 114));
          width: 15em;
          padding: 1em;
          border-radius: 0.4em;
          color: $color-dark;
          border: 2px solid rgb(190, 190, 190);
          &:hover {
            background: linear-gradient(120.21deg, #cacaca, rgb(97, 107, 133));
            border-right-color: rgba(187, 215, 226, 0.438);
          }
          &:active {
            background: linear-gradient(120.21deg, #e2b7b7, rgb(175, 82, 139));
          }
        }
        #apple-logo {
          font-size: $fontSize-m;
          padding-right: 4px;
        }

        &-text {
          display: inline-block;
          // border: $borderTest;
          font-weight: 600;
        }
      }

      &-playstore {
        padding-top: 1.5em;
        #google-play {
          @include flexCentered;
          background: linear-gradient(120.21deg, #babdc2, rgb(104, 107, 114));
          width: 15em;
          padding: 1em;
          border-radius: 0.4em;
          color: $color-dark;
          border: 2px solid rgb(190, 190, 190);

          &:hover {
            background: linear-gradient(120.21deg, #cacaca, rgb(97, 107, 133));
            border-right-color: rgba(187, 215, 226, 0.438);
          }
          &:active {
            background: linear-gradient(120.21deg, #e2b7b7, rgb(175, 82, 139));
          }
        }

        #google-play-logo {
          font-size: 2rem;
          padding-right: 4px;
        }
      }
    }

    &__copyright {
      color: $color-para;
      height: 10vh;
      font-size: $fontSize-S;
      @include flexCentered;
      border-top: 2px solid whitesmoke;
      padding: 5em;
    }

    @media screen and (max-width: 790px) {
      &__nav-container {
        @include flexCentered;
        flex-direction: column;
      }

      &__right__download__btn-container {
        @include flexCentered;
      }
      &__right__download {
        @include flexCentered;
        flex-direction: column;
        width: 100%;
        padding-bottom: 2em;
      }
      &__right__download-playstore {
        padding: 0;
        margin-left: 1em;
      }
    }

    @media screen and (max-width: 580px) {
      &__left-logo {
        width: 70px;
      }
      &__top-container {
        padding: 2em;
      }

      &__left-text {
        padding: 1em;
      }
      &__middle {
        width: 100%;
        padding-top: 1em;
      }
    }

    @media screen and (max-width: 470px) {
      &__top-container {
        @include flexCentered;
        flex-direction: column-reverse;
        // background-color: blueviolet;
      }

      &__left {
        width: 100%;
        text-align: center;
        &-social-icon-container {
          justify-content: center;
        }
      }
    }

    @media screen and (max-width: 300px) {
      &__right__download__btn-container {
        @include flexCentered;
        flex-direction: column;
      }

      &__right__download-playstore {
        padding-top: 2em;
        margin-left: 0;
      }
    }
  }

  // @media screen and (max-width: 790px) {
  //   // height: 124vh;
  // }
  @media screen and (max-width: 470px) {
    margin-top: 2em;
  }
}
